class Input extends Component{
    constructor(props){
        super(props)
        this.state={
            name: "",
            text: ""
        }
        this.changeName=this.changeName.bind(this);
    }

    changeName(){
        this.setState({name:'Reactjs'});
    }
      render(){
          return(
              <div>
                  <h1>{this.state.name}</h1>
                  <input type="text" name="JavaScript" value="JavaScript"></input><br></br>
                  <button onClick={this.changeName}>Button</button>   
              </div>
        );
      }

}
export default Input;
